import React from 'react';
import './Advertising.css';
import advertisingPercentSale from '../assets/images/advertising-50percent-sale.jpg';
import cartIcon from '../assets/images/cart-icon.png';

class AdvertisingOffer extends React.Component {
	render(){
		return (
			<div className="avdertising-offer">
				<img src={advertisingPercentSale} />
				<div className="avdertising-offer-content">
					<h3 className="avdertising-offer-header">full winter kit</h3>	
					<p className="avdertising-offer-text">Half Jacket + Skiny Trousers + Boot leather</p>
				</div>
				<div className="">
					<img src={cartIcon} />
					<span>120 $</span>
				</div>
			</div>
		)
	}
}

export default AdvertisingOffer;
